    //puertos destino
    void LlenaPuertosDestino(String Pais)
    {
        //puerto origen
        Puertos_Destino.Clear();
        String connString = config.GetConnectionString("MySqlNaviera");
        using var connectionPuertos = new MySqlConnection(connString);
